'From Squeak3.2alpha of 2 October 2001 [latest update: #4447] on 24 October 2001 at 4:40:05 pm'!"Change Set:		sampleImageForm-swDate:			24 October 2001Author:			Scott WallaceAllows Morph classes to provide their own sample images for the benefit of thumbnail creation; this allow us to avoid launching sample instances only for the benefit of obtaining thumbnails when the very launching of those sample instances may have consequences we do not want, such as initializing the network or asking the user an unexpected question.The capabilitiy is illustrated by the AudioChatGUI morph (where we wish to avoid actually initiating a session just to create an icon!!), as well as by two StarSqueak examples, where the appearance of the initial condition of a simulation is much less appropriate than the appearance after the simulation has run for some time."!Object subclass: #DescriptionForPartsBin	instanceVariableNames: 'formalName categoryList documentation globalReceiverSymbol nativitySelector sampleImageForm '	classVariableNames: ''	poolDictionaries: ''	category: 'Morphic-PartsBin'!!Object methodsFor: 'parts bin' stamp: 'sw 10/24/2001 16:34'!descriptionForPartsBin	"If the receiver is a member of a class that would like to be represented in a parts bin, answer the name by which it should be known, and a documentation string to be provided, for example, as balloon help.  When the 'nativitySelector' is sent to the 'globalReceiver', it is expected that some kind of Morph will result.  The parameters used in the implementation below are for documentation purposes only!!"	^ DescriptionForPartsBin		formalName: 'PutFormalNameHere'		categoryList: #(PutACategoryHere MaybePutAnotherCategoryHere)		documentation: 'Put the balloon help here'		globalReceiverSymbol: #PutAGlobalHere		nativitySelector: #PutASelectorHere! !!DescriptionForPartsBin methodsFor: 'initialization' stamp: 'sw 10/24/2001 15:29'!sampleImageForm	"If I have a sample image form override stored, a